#!/usr/bin/env php
<?php
require_once 'vendor/autoload.php';

/**
 * Tools to convert countries in different formats
 * @author mledoze
 * @see https://github.com/mledoze/countries
 */

use MLD\Console\Command\ExportCommand;
use Symfony\Component\Console\Application;

$application = new Application();
$application->add(new ExportCommand(
	__DIR__ . DIRECTORY_SEPARATOR . 'countries.json',
	__DIR__ . DIRECTORY_SEPARATOR . 'dist'
));
$application->run();

export interface OfficialAndCommon {
  common: string
  official: string
}

export interface CountryName extends OfficialAndCommon {
  native: {
    [languageCode: string]: OfficialAndCommon
  }
}

export interface Currency {
  name: string
  symbol: string
}

export interface IntlDirectDialingCode {
  root: string
  suffixes: string[]
}

export interface Demonyms {
  f: string
  m: string
}

export interface Country {
  name: CountryName
  tld: string[]
  cca2: string
  ccn3: string
  cca3: string
  cioc: string
  independent: boolean
  status: string
  currencies: { [currencyCode: string]: Currency }
  idd: IntlDirectDialingCode
  capital: string[]
  altSpellings: string[]
  region: string
  subregion: string
  languages: { [languageCode: string]: string }
  translations: { [languageCode: string]: OfficialAndCommon }
  latlng: [number, number]
  demonyms: { [languageCode: string]: Demonyms }
  landlocked: boolean
  borders: string[]
  area: number
  flag: string
}

export type Countries = Country[]

declare const countries: Countries

export default countries

